import React from "react";
import {SplitText} from './SplitText';
import {TweenMax} from './TweenMax';

const $ = window.$;
var text = $(".split");

var split = new SplitText(text);

function random(min, max){
	return (Math.random() * (max - min)) + min;
}

$(split.chars).each(function(i){
	TweenMax.from($(this), 2.5, {
		opacity: 0,
		x: random(-500, 500),
		y: random(-500, 500),
		z: random(-500, 500),
		scale: .1,
		delay: i * .02,
		yoyo: true,
		repeat: -1,
		repeatDelay: 10
	});
});

const LandingPage = () => (
  <div>
    <h1>I command computers to perform tasks.</h1>

    <p>This page is public, accessible by everyone</p>

    <p className="split">
    Hello there, my name is Kaye. I am an experienced multimedia designer with all sorts of other experiences under my belt. As an upcoming Software Engineering student, I could not be more thrilled about studying algorithms, cryptocurrency, and technologies of the future. I love to cultivate a growth mindset, who else would I rather be?
    </p>
  </div>
);

export default LandingPage;
